import React from 'react'
import { useNavigate } from 'react-router-dom'

function Login() {
    const navi = useNavigate();

    const handle = () => {
        navi('/Login');
    }

    return (
        <div>
            <p style={{color: 'black'}}>Welcome</p>
            <button onClick={handle}>Go to login</button>
        </div>
    )
}

export default Welcome
